e\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:64:\"<a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:3:\"4.7\";s:12:\"requires_php\";s:3:\"5.6\";s:6:\"tested\";s:5:\"5.5.3\";s:5:\"added\";s:10:\"2014-07-11\";s:12:\"last_updated\";s:10:\"2020-11-03\";s:11:\"description\";s:1349:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! <a href=\"https://www.advancedcustomfields.com/pro/\">Learn more</a></p>\";s:12:\"installation\";s:503:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li><strong>Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:5391:\"<h4>5.9.3</h4>\n<p><em>Release Date - 3 November 2020</em></p>\n\n<ul>\n<li>Fix - Fixed bug causing Revision meta to incorrectly update the parent Post meta.</li>\n<li>Fix - Fixed bug breaking \"Filter by Post Type\" and \"Filter by Taxonomy\" Field settings.</li>\n</ul>\n\n<h4>5.9.2</h4>\n<p><em>Release Date - 29 October 2020</em></p>\n\n<ul>\n<li>Enhancement - Added experiment for preloading block HTML and reducing AJAX requests on page load.</li>\n<li>Fix - Added boolean attribute value detection to JSX parser (fixes issue with templateLock=\"false\").</li>\n<li>Fix - Added \"dateTime\" attribute to JSX parser ruleset.</li>\n<li>Fix - Fixed unresponsive Select2 instances after duplicating a row or layout.</li>\n<li>Fix - Added missing Color Picker script translations for previous WordPress versions.</li>\n<li>Fix - Fixed bug in Clone Field causing potential PHP error if cloning a Field Group that no longer exists.</li>\n<li>Fix - Fixed PHP warning logged when comparing a revision that contains values for a Field that no longer exist.</li>\n<li>Dev - Added <code>$wp_block</code> parameter to block render_callback and render_template (unavailable during AJAX preview requests).</li>\n<li>Dev - Deprecated <code>acf_get_term_post_id()</code> function.</li>\n</ul>\n\n<h4>5.9.1</h4>\n<p><em>Release Date - 8 September 2020</em></p>\n\n<ul>\n<li>Fix - Fixed guten-bug causing \"Preview Post\" button to publish changes.</li>\n<li>Fix - Fixed guten-bug causing JS errors when editing with Elementor or Beaver Builder.</li>\n<li>Fix - Fixed bug in Color Picker field causing JS error on front-end forms.</li>\n<li>Fix - Fixed bug in Post Taxonomy location rule causing incomplete list of rule choices.</li>\n<li>Fix - Reverted Local JSON \"save to source path\" enhancement due to DX feedback. </li>\n<li>i18n - Updated Indonesian translations thanks to Rio Bahtiar.</li>\n<li>i18n - Updated Turkish translation thanks to Emre Erkan.</li>\n</ul>\n<p>* Added toolbar across all ACF admin pages.</p>\n<p>* Added new table columns: Description, Key, Location, Local JSON.</p>\n<p>* Added popup modal to review Local JSON changes before sync.</p>\n<p>* Added visual representation of where Field Groups will appear.</p>\n<p>* Added new help tab.</p>\n<p>* Simplified layout.</p>\n<ul>\n<li>Enhancement - New ACF Blocks features.</li>\n</ul>\n<p>* Added support for Inner Blocks.</p>\n<p>* Added new \"jsx\" setting.</p>\n<p>* Added new \"align_text\" settings.</p>\n<p>* Added new \"align_content\" settings.</p>\n<ul>\n<li>Enhancement - Added duplicate functionality for Repeater and Flexible Content fields.</li>\n<li>Enhancement - Added PHP validation support for Gutenberg.</li>\n<li>Enhancement - Added ability to bypass confirmation tooltips (just hold shift).</li>\n<li>Enhancement - Local JSON files now save back to their loaded source path (not \"save_json\" setting).</li>\n<li>Tweak - Replaced all custom icons with dashicons.</li>\n<li>Tweak - Changed custom post status label from \"Inactive\" to \"Disabled\".</li>\n<li>Tweak - Improved styling of metaboxes positioned in the block editor sidebar.</li>\n<li>Fix - Improved AJAX request efficiency when editing block className or anchor attributes.</li>\n<li>Fix - Fixed bug causing unresponsive WYSIWYG fields after moving a block via the up/down arrows.</li>\n<li>Fix - Fixed bug causing HTML to jump between multiple instances of the same Reusable Block.</li>\n<li>Fix - Fixed bug sometimes displaying validation errors when saving a draft.</li>\n<li>Fix - Fixed bug breaking Image field UI when displaying a scaled portrait attachment.</li>\n<li>Fix - Fixed bug in Link field incorrectly treating the \"Cancel\" button as \"Submit\".</li>\n<li>Fix - Fixed bug where a sub field within a collapsed Repeater row did not grow to the full available width.</li>\n<li>Fix - Ensured all archive URLs shown in the Page Link field dropdown are unique.</li>\n<li>Fix - Fixed bug causing incorrect conditional logic settings on nested fields when duplicating a Field Group.</li>\n<li>Fix - Fixed bug causing license activation issues with some password management browser extensions.</li>\n<li>Dev - Major improvements to <code>ACF_Location</code> class.</li>\n<li>Dev - Refactored all location classes to optimize performance.</li>\n<li>Dev - Extracted core JavaScript from \"acf-input.js\" into a separate \"acf.js\" file.</li>\n<li>Dev - Field Group export now shows \"active\" attribute as bool instead of int.</li>\n<li>Dev - Added filter \"acf/get_object_type\" to customize WP object information such as \"label\" and \"icon\".</li>\n<li>Dev - Added action \"acf/admin_print_uploader_scripts\" fired when printing uploader (WP media) scripts in the footer.</li>\n<li>Dev - Added filters \"acf/pre_load_attachment\" and \"acf/load_attachment\" to customize attachment details.</li>\n<li>Dev - Added filter \"acf/admin/toolbar\" to customize the admin toolbar items.</li>\n<li>Dev - Added new JS actions \"duplicate_fields\" and \"duplicate_field\" fired when duplicating a row.</li>\n<li>i18n - Changed Croatian locale code from \"hr_HR to \"hr\".</li>\n<li>i18n - Updated Portuguese translation thanks to Pedro Mendonça.</li>\n<li>i18n - Updated French Canadian translation thanks to Bérenger Zyla.</li>\n<li>i18n - Updated French translation thanks to Maxime Bernard-Jacquet.</li>\n<li>i18n - Updated German translations thanks to Ralf Koller.